// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./Blacklist.sol";

contract MyToken is ERC20, ERC20Burnable, Ownable, Blacklist {
    Blacklist public blacklist;
    address onr;
    uint tokenprice;

    constructor() ERC20("name", "sol") {
        _mint(msg.sender, 1000 * (10**18));
        onr = msg.sender;
        tokenprice= 10 wei;
    }

    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount);
    }

    function burn(address useradd, uint256 amount) public {
        _burn(useradd, amount);
    }



    function buyTokens(uint256 noOfToken) public payable {
        require( !blacklist.isBlacklisted(msg.sender),
            "You are blacklisted and cannot buy tokens."
        );
        require(noOfToken > 0, "Amount must be greater than 0");
        require(msg.value >= noOfToken*tokenprice, "Inappropriate Ether sent");
        // Calculate the number of tokens to transfer based on the amount of Ether sent


        // Transfer tokens to the buyer
        _transfer(owner(), msg.sender, noOfToken);

    }



       function transfer(address to, uint256 amount) public virtual override returns (bool) {

        require(!blacklist.isBlacklisted(msg.sender) && !blacklist.isBlacklisted(to) , "You are blacklisted");
        address owne = _msgSender();
        _transfer(owne, to, amount);
        return true;
    }

    function transferFrom(address from, address to, uint256 amount) public virtual override returns (bool) {
        require(blacklist.isBlacklisted(from) && !blacklist.isBlacklisted(to), "You are blacklisted");
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);
        return true;
    }
}

Blacklist.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Blacklist is Ownable {
    mapping(address => bool) public isBlacklisted;

    event UserBlacklisted(address indexed user);
    event UserRemovedFromBlacklist(address indexed user);

 
    function blacklistUser(address user) public onlyOwner {
        require(!isBlacklisted[user], "User is already blacklisted");
        isBlacklisted[user] = true;
        emit UserBlacklisted(user);
    }

 
    function removeFromBlacklist(address user) public onlyOwner {
        require(isBlacklisted[user], "User is not blacklisted");
        isBlacklisted[user] = false;
        emit UserRemovedFromBlacklist(user);
    }
}

